import { Link } from "react-router-dom";
import {
  BrowserRouter,
  Routes,
  Route,
  Navigate
} from "react-router-dom";
import Login from "./routes/login/index";
import Register from "./routes/register/index";
import ForgotPassword from "./routes/forgot-password/index";
import Home from "./routes/home/index";
import OnGoingActivity from "./routes/on-going-activity/index";
import History from "./routes/history/index";
import Profile from "./routes/profile/index";
import Services from "./routes/services/index";
import CashIn from "./routes/cash-in/index";
import Default from "./routes/default/index";
import Weather from "./routes/weather/index";
import { useAuth0 } from '@auth0/auth0-react';

export default function App() {

  const {
    isAuthenticated,
    loginWithRedirect, logout, user
  } = useAuth0();

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Default />} />
        <Route path="login" element={<Default />} />
        <Route path="register" element={<Register />} />
        <Route path="weather" element={<Weather />} />
        <Route path="forgot-password" element={<ForgotPassword />} />
        <Route path="home" element={isAuthenticated != null ? <Home /> : <Navigate to="/login" />} />
      </Routes>
    </BrowserRouter>
  );
}
